import React, { useState } from "react";
import "../Styles/Contact.css";

function Contact() {
  const [formData, setFormData] = useState({
    cuname: "",
    coname: "",
    conumber: "",
    cuemail: "",
    cuabout: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    console.log("Form Data:", formData);

    // Assuming the Express server is running on port 5000
    const serverUrl = "http://localhost:3000/contact";

    try {
      const response = await fetch(serverUrl, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert("Form submitted successfully!");
      } else {
        alert("Error submitting form. Please try again later.");
      }
    } catch (error) {
      alert("Network error. Please try again later.");
    }
  };

  return (
    <div>
      <div className="container-form">
        <h1>INQUIRE</h1>
        <form onSubmit={handleSubmit} className="form-group">
          <input
            type="text"
            placeholder="Enter your name"
            id="cuname"
            name="cuname"
            value={formData.cuname}
            onChange={handleChange}
          ></input>

          <input
            type="text"
            placeholder="Company Name"
            id="coname"
            name="coname"
            value={formData.coname}
            onChange={handleChange}
          ></input>

          <input
            type="text"
            placeholder="Enter your contact number"
            id="conumber"
            name="conumber"
            value={formData.conumber}
            onChange={handleChange}
          ></input>

          <input
            type="text"
            placeholder="Enter your email address"
            id="cuemail"
            name="cuemail"
            value={formData.cuemail}
            onChange={handleChange}
          ></input>

          <input
            type="text"
            placeholder="Enter your query"
            id="cuabout"
            name="cuabout"
            value={formData.cuabout}
            onChange={handleChange}
          ></input>

          <input
            type="submit"
            id="cusubmit"
            name="cusubmit"
            value="Submit"
          ></input>
        </form>
      </div>
      <div className="location">
        <div className="address-sec">
          <h1>CONTACT INFO</h1>
          <p>
            <strong>Windsor Precision Works</strong>
            <br></br>6240 Hawthorne Drive
            <br></br>Windsor, ON N8T 1J9
            <br></br>Canada
            <br></br>
            <br></br>519-721-4143
            <br></br>
            <a href="mailTo:info@precisionworks.ca">info@precisionworks.ca</a>
          </p>
        </div>
        <div className="container-map">
          <iframe
            height="300cm"
            width="500"
            src="https://maps.google.com/maps?width=100%25&amp;height=600&amp;hl=en&amp;q=6240%20Hawthorne%20Drive+(Windsor%20Precision%20Works)&amp;t=&amp;z=14&amp;ie=UTF8&amp;iwloc=B&amp;output=embed"
          ></iframe>
        </div>
      </div>
    </div>
  );
}

export default Contact;
